export const generateRandomArr = (size) => {
  let arr = [];
  for (let i = 1; i <= size; i++) {
    arr.push({ value: i });
  }
  for (let i = 0; i < size; i++) {
    let randomIndex = Math.floor(Math.random() * size);
    let temp;
    temp = arr[i];
    arr[i] = arr[randomIndex];
    arr[randomIndex] = temp;
  }
  return arr;
};
